private boolean isDuplicateDynField(List<DynamicField> dFields, SchemaField f) {
  boolean dup = false;
  for( DynamicField df : dFields ) {
    if( df.regex.equals( f.name ) ) {
      dup = true;
      break;
    }
  }
  return dup;
}

private boolean isDuplicateDynField(List<DynamicField> dFields, SchemaField f) {
  for( DynamicField df : dFields ) {
    if( df.regex.equals( f.name ) ) return true;
  }
  return false;
}

